function Tradeskills:GetLocaleData(item)

	if LOCALE == "enUS" then
		return item
	end

	local tradeskillID = item.tradeskill
	local id = item.itemID

	if tradeskillID == 333 then

		if tradeskillLocales.enchants[LOCALE] and tradeskillLocales.enchants[LOCALE][id] then
			return tradeskillLocales.enchants[LOCALE][id];
		end
	else

		if tradeskillLocales.items[LOCALE] and tradeskillLocales.items[LOCALE][id] then
			return tradeskillLocales.items[LOCALE][id];
		end
	end

end



